import React from "react";

const MarketBasket = () => {
  return (
    <div style={{ padding: "20px" }}>
      <h2>Market Basket Analysis</h2>
      <p>This page will display association rules and frequent itemsets.</p>
    </div>
  );
};

export default MarketBasket;
